<style>
body{
margin:0;
font-family:sans-serif;
display:flex;
justify-content:center;
align-items:center;
height:100vh;
background:linear-gradient(-45deg,#ff9a9e,#fad0c4,#fbc2eb,#a6c1ee);
background-size:400% 400%;
animation:bg 10s infinite;
}

@keyframes bg{
0%{background-position:0% 50%}
50%{background-position:100% 50%}
100%{background-position:0% 50%}
}

.card{
background:white;
padding:20px;
border-radius:20px;
width:92%;
max-width:380px;
text-align:center;
box-shadow:0 10px 30px rgba(0,0,0,.2);
animation:fade 1s;
}

@keyframes fade{from{opacity:0;transform:scale(.9)}}

img{width:100%;border-radius:18px;box-shadow:0 0 25px pink}

button{
margin:6px;
padding:12px 16px;
border:none;
border-radius:12px;
background:#ff6fa5;
color:white;
font-size:15px;
}

.popup{
position:fixed;
top:0;left:0;
width:100%;height:100%;
background:rgba(0,0,0,.7);
display:flex;
justify-content:center;
align-items:center;
visibility:hidden;
}

.box{background:white;padding:25px;border-radius:20px}

canvas{position:fixed;top:0;left:0;pointer-events:none}

#secretBtn{display:none;background:#b06cff}

.balloon{
position:fixed;
bottom:-120px;
width:60px;
height:80px;
border-radius:50%;
animation:floatUp linear forwards;
}
@keyframes floatUp{
to{transform:translateY(-120vh);}
}
.firework{
position:fixed;
width:6px;
height:6px;
border-radius:50%;
}
</style>

function closePop(){document.getElementById("popup").style.visibility="hidden"}

setTimeout(()=>{document.getElementById("secretBtn").style.display="inline-block"},5000);

onresize=()=>{canvas.width=innerWidth;canvas.height=innerHeight}

// Balloons
setInterval(()=>{
let b=document.createElement("div");
b.className="balloon";
b.style.left=Math.random()*100+"vw";
b.style.background=`hsl(${Math.random()*360},100%,70%)`;
b.style.animationDuration=(5+Math.random()*5)+"s";
document.body.appendChild(b);
setTimeout(()=>b.remove(),10000);
},900);

// Fireworks
function fireworks(){
for(let i=0;i<80;i++){
let f=document.createElement("div");
f.className="firework";
f.style.left=innerWidth/2+"px";
f.style.top=innerHeight/2+"px";
f.style.background=`hsl(${Math.random()*360},100%,60%)`;
document.body.appendChild(f);

let angle=Math.random()*2*Math.PI;
let dist=Math.random()*300;

f.animate([
{transform:"translate(0,0)",opacity:1},
{transform:`translate(${Math.cos(angle)*dist}px,${Math.sin(angle)*dist}px)`,opacity:0}
],{duration:1000,easing:"ease-out"});

setTimeout(()=>f.remove(),1000);
}
}
setInterval(fireworks,4000);
</script>
